import React from 'react';
import '../styles/Experience.css';

export default function Experience() {
  const projects = [
    {
      title: 'Art & Design',
      description: 'Curiosity leads to creativity.',
      image: '/assets/art-design.png',
    },
    {
      title: 'Beauty',
      description: 'Simplicity is the ultimate sophistication.',
      image: '/assets/beauty.png',
    },
    // Add more projects as needed
  ];

  return (
    <div className="experience-container">
      <h1 className="experience-heading">My Projects</h1>
      <div className="bento-grid">
        {projects.map((project, index) => (
          <div key={index} className="bento-box" style={{ backgroundImage: `url(${project.image})` }}>
            <div className="bento-overlay">
              <h2 className="project-title">{project.title}</h2>
              <p className="project-description">{project.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
